import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import {
  Box,
  Typography,
  Button,
  Grid,
  Paper,
  LinearProgress,
  TextField,
} from '@mui/material';
import { io, Socket } from 'socket.io-client';

interface PetState {
  happiness: number;
  energy: number;
  chaos: number;
  mood: string;
  thoughts: string[];
}

const PetInteraction: React.FC = () => {
  const { petId } = useParams<{ petId: string }>();
  const [socket, setSocket] = useState<Socket | null>(null);
  const [petState, setPetState] = useState<PetState>({
    happiness: 50,
    energy: 50,
    chaos: 0,
    mood: 'neutral',
    thoughts: [],
  });
  const [message, setMessage] = useState('');

  useEffect(() => {
    const newSocket = io('http://localhost:3001');
    setSocket(newSocket);

    newSocket.on('petState', (state: PetState) => {
      setPetState(state);
    });

    return () => {
      newSocket.close();
    };
  }, []);

  const handleAction = (action: string) => {
    socket?.emit('petAction', { petId, action });
  };

  const handleSendMessage = () => {
    if (message.trim()) {
      socket?.emit('petMessage', { petId, message });
      setMessage('');
    }
  };

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Interact with {petId}
      </Typography>

      <Grid container spacing={3}>
        <Grid item xs={12} md={8}>
          <Paper sx={{ p: 3, mb: 3 }}>
            <Typography variant="h6" gutterBottom>
              Stats
            </Typography>
            <Box sx={{ mb: 2 }}>
              <Typography>Happiness</Typography>
              <LinearProgress variant="determinate" value={petState.happiness} />
            </Box>
            <Box sx={{ mb: 2 }}>
              <Typography>Energy</Typography>
              <LinearProgress variant="determinate" value={petState.energy} />
            </Box>
            <Box sx={{ mb: 2 }}>
              <Typography>Chaos</Typography>
              <LinearProgress variant="determinate" value={petState.chaos} />
            </Box>
          </Paper>

          <Paper sx={{ p: 3, mb: 3 }}>
            <Typography variant="h6" gutterBottom>
              Actions
            </Typography>
            <Grid container spacing={2}>
              <Grid item>
                <Button variant="contained" onClick={() => handleAction('pet')}>
                  Pet
                </Button>
              </Grid>
              <Grid item>
                <Button variant="contained" onClick={() => handleAction('feed')}>
                  Feed
                </Button>
              </Grid>
              <Grid item>
                <Button variant="contained" onClick={() => handleAction('poke')}>
                  Poke
                </Button>
              </Grid>
              <Grid item>
                <Button variant="contained" onClick={() => handleAction('sing')}>
                  Sing To
                </Button>
              </Grid>
            </Grid>
          </Paper>

          <Paper sx={{ p: 3 }}>
            <Typography variant="h6" gutterBottom>
              Send Message
            </Typography>
            <Box sx={{ display: 'flex', gap: 2 }}>
              <TextField
                fullWidth
                variant="outlined"
                value={message}
                onChange={(e) => setMessage(e.target.value)}
                placeholder="Type a message..."
              />
              <Button variant="contained" onClick={handleSendMessage}>
                Send
              </Button>
            </Box>
          </Paper>
        </Grid>

        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 3 }}>
            <Typography variant="h6" gutterBottom>
              Pet's Thoughts
            </Typography>
            {petState.thoughts.map((thought, index) => (
              <Typography key={index} sx={{ mb: 1 }}>
                {thought}
              </Typography>
            ))}
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default PetInteraction;
